import { Layout, Row, Col } from 'antd';
import { Table, Divider, Tag } from 'antd';


import Head from 'next/head'

import HeaderComponent from '../../components/Header';

const { Content, Footer } = Layout;

const Pipelines = () => {


  const columns = [
    {
      title: 'Region',
      dataIndex: 'region',
      key: 'region',
      // render: text => <a>{text}</a>,
    },
    {
      title: 'Workstream',
      dataIndex: 'workstream',
      key: 'workstream',
      // render: text => <a>{text}</a>,
    },
    {
      title: 'Scheduler',
      dataIndex: 'scheduler_name',
      key: 'scheduler_name',
    },
    {
      title: 'Pipeline',
      dataIndex: 'pipeline_name',
      key: 'pipeline_name',
    },
    {
      title: 'Address',
      dataIndex: 'address',
      key: 'address',
    },
  ];

  const data = [
    {
      key: '1',
      workstream: 'John Brown',
      region: 'John Brown',
      scheduler_name: 32,
      pipeline_name: 32,
      address: 'New York No. 1 Lake Park',
    },
    {
      key: '2',
      workstream: 'Jim Green',
      region: 'John Brown',
      scheduler_name: 42,
      pipeline_name: 32,
      address: 'London No. 1 Lake Park',
    },
    {
      key: '3',
      workstream: 'Jim Green',
      region: 'John Brown',
      scheduler_name: 42,
      pipeline_name: 32,
      address: 'London No. 1 Lake Park',
    },
    {
      key: '4',
      workstream: 'Jim Green',
      region: 'John Brown',
      scheduler_name: 42,
      pipeline_name: 32,
      address: 'London No. 1 Lake Park',
    },
  ];

  return (
    <Table columns={columns} dataSource={data} />
  );
};

const ViewPipelines = () => {
  return (
		<Layout className="layout">

			<Head>
        <title>View Pipelines</title>
        <meta name="viewport" content="initial-scale=1.0, width=device-width" />
      </Head>

			<HeaderComponent />

			<Content>
				<div style={{ background: '#fff', padding: 24, minHeight: 720 }}>
					<Row>
						<Col span={20} offset={2}>
							<Pipelines />
						</Col>
					</Row>
				</div>
			</Content>

		<Footer>
			<Row>
				<Col span={16} offset={4}>
					<center><h4>Footer</h4></center>
				</Col>
			</Row>
		</Footer>
  </Layout>
  );
};

export default ViewPipelines;
